import React, { useState } from "react";
import { useContext, useEffect } from "react";

import { StyleSheet, Text, View, Button, ScrollView } from "react-native";

import TextItem1 from "../components/TextItem1";
import TextItem2 from "../components/TextItem2";
import TextItem3 from "../components/TextItem3";
import TextItem4 from "../components/TextItem4";
import TextItem5 from "../components/TextItem5";

import { DataContext } from "./../App";

export default function Market({ navigation }) {
  const { DataList1, DataList2, DataList3, DataList4, DataList5 } =
    useContext(DataContext);
  return (
    <View style={styles.container}>
      <View style={styles.marketSection}>
        <ScrollView>
          {DataList1.map((text1, index) => (
            <TextItem1
              key={index}
              text1={text1.text1}
              dataDemand1={text1.dataDemand1}
              price1={text1.price1}
            />
          ))}
          {DataList2.map((text2, index) => (
            <TextItem2
              key={index}
              text2={text2.text2}
              dataDemand2={text2.dataDemand2}
              price2={text2.price2}
            />
          ))}
          {DataList3.map((text3, index) => (
            <TextItem3
              key={index}
              text3={text3.text3}
              dataDemand3={text3.dataDemand3}
              price3={text3.price3}
            />
          ))}
          {DataList4.map((text4, index) => (
            <TextItem4
              key={index}
              text4={text4.text4}
              dataDemand4={text4.dataDemand4}
              price4={text4.price4}
            />
          ))}
          {DataList5.map((text5, index) => (
            <TextItem5
              key={index}
              text5={text5.text5}
              dataDemand5={text5.dataDemand5}
              price5={text5.price5}
            />
          ))}
        </ScrollView>
      </View>
      <View style={styles.categoriesSection}></View>
      <View style={styles.activitiesSection}></View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    alignItems: "center",
    justifyContent: "center",
    flexDirection: "row",
    backgroundColor: "#FFFFFF",
    width: "100%",
    height: "100%",
  },

  //   Market section
  marketSection: {
    flex: 8,
    width: "100%",
    height: "100%",
    backgroundColor: "#FFFFFF",
    flexDirection: "column",
    padding: 40,
  },

  // Categories section
  categoriesSection: {
    flex: 6,
    width: "100%",
    height: "100%",
    marginLeft: 20,
    backgroundColor: "#EFF5FD",
    flexDirection: "column",
    paddingLeft: 40,
    paddingTop: 40,
    paddingBottom: 40,
  },

  //Activities section
  activitiesSection: {
    flex: 6,
    width: "100%",
    height: "100%",
    backgroundColor: "#E0EEFF",
    flexDirection: "column",
    paddingTop: 40,
    paddingBottom: 40,
  },
});
